import React from 'react';

function Contact() {
  return (
    <section id="contact" className="contact">
    <h2>Contato</h2>
    <p>
      Me envie uma mensagem pelo 
      <a href="https://wa.me/5561986115281" target="_blank" rel="noopener noreferrer"> WhatsApp</a>
      <br /> ou pelo e-mail 
      <a href="mailto:ff.s4ntoss@gmail.com"> ff.s4ntoss@gmail.com</a>
    </p>
  </section>
  );
}

export default Contact;
